import React from 'react';

const AboutUs = () => {
  return (
    <div className="container">
      <h1>About Us</h1>
      <p>
        Welcome to Dark Woods Media. We are dedicated to providing you with the best selection of movies at competitive prices.
        Our team is passionate about films and committed to excellent customer service.
      </p>
      <p>
        Founded in 2024, Dark Woods Media aims to deliver a seamless shopping experience for movie enthusiasts.
        Whether you're looking for classics, new releases, or rare finds, we have something for everyone.
      </p>
    </div>
  );
};

export default AboutUs;
